import React from 'react';
import { MDBFooter, MDBBtn, MDBIcon } from 'mdbreact';

const Footer = () => {
    return (
        <MDBFooter color="Yellow" className="text-center font-small darken-2">
            <div className="pt-4">
                <MDBBtn outline color="white" tag="a" href="">sandra.laza4@gmail.com</MDBBtn>
                    <hr className="my4"/>
                    RAKOTONDRATSIMA Lazanirina S.
            </div>
        </MDBFooter>
    );
}

export default Footer;
